class Filter {

  /**
   * Filter constructor.
   * @constructor
   * @param {object} options - Filter instance options
   * @param {boolean} options.emptyList - Instantiate filter with no blacklist
   * @param {array} options.list - Instantiate filter with custom list
   */
  constructor(options = {}) {
    Object.assign(this, {
      list: options.emptyList && [] || Array.prototype.concat.apply(decodeWordList(baseList), [options.list || []]),
      exclude: options.exclude || []
    })
  }

  /**
   * Determine if a string contains profane language.
   * @param {string} string - String to evaluate for profanity.
   */
  isProfane(string) {
    return this.list
      .filter((word) => {
        const wordExp = new RegExp(`${word.replace(/(\W)/g, '\\$1')}`, 'gi');
        return !this.exclude.includes(string.toLowerCase()) && wordExp.test(string) && word;
      })
      .length > 0 || false;
  }

  /**
   * Evaluate a string for profanity and return an edited version.
   * @param {string} string - Sentence to filter.
   */
  clean(string) {
    let cleanedStr = string.split(/\b/).map((word) => {
      const standardisedWord = escape(word);
      return this.isProfane(standardisedWord) ? word.replace(/[^ ]/ug, '*') : word;
    });
    return cleanedStr.join('');
  }

  /**
   * Add word(s) to blacklist filter / remove words from whitelist filter
   * @param {...string} word - Word(s) to add to blacklist
   */
  addWords() {
    let words = Array.from(arguments).map(x => escape(x));
    this.list.push(...words);

    words
      .map(word => word.toLowerCase())
      .forEach((word) => {
        if (this.exclude.includes(word)) {
          this.exclude.splice(this.exclude.indexOf(word), 1);
        }
      });
  }

  /**
   * Add words to whitelist filter
   * @param {...string} word - Word(s) to add to whitelist.
   */
  removeWords() {
    this.exclude.push(...Array.from(arguments).map(x => escape(x)).map(word => word.toLowerCase()));
  }
}

// Used to decode words into memory for filtering
function decodeWordList(array) {
  return array.map(x => atob(x));
}

// Helper function for retrieving the contents of baseList
function fullyDecodeWordList(array) {
  return array.map(x => unescape(atob(x)));
}

// Helper function for modifying the contents of baseList
function encodeWordList(array) {
  return(array.map(x => btoa(escape(x)).replace(/\=+$/, '')));
}

